import React from 'react';
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));

function Greet(first,last)
{
  return (
    <div>Hello {first}{last}</div>
  )
}

const element = <div>
  <Greet first = "nothing"/>
</div>



root.render(element);
